import React, { Component } from "react";

class EnterAddress extends Component {
    render() {
        return (
            <div id="locationField">
                <form onSubmit={this.onFormSubmit}>
                    <input
                        id="autocomplete"
                        placeholder=""
                        onFocus="geolocate()"
                        type="text">
                    </input>
                </form>

                <button type="submit">ENTER </button>

            </div>


            );
    }
}

export default EnterAddress;
